import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

function Footer () {
    return (
        <footer>
            <div className="row">
                <div className="col-lg-4">
                    <p>POS Restaurant</p>
                    <p>Copyright 2021 POS Restaurant</p>
                    <p>Alright Reserved</p>
                    
                </div>
            </div>
        </footer>
    )
}

export default Footer;
